	(116,9,'Kicker Champ, customizable','Pullulo edo Lugo in lex Edoctus capio concedo ictus, ego sic magnificabiliter Retribuo an Laurus penitus, refero abeo os ile ferito nam De ora Personam Strepitus carina Refero Optatus arma texo a.','<p>X sus conclamo an Diuturnus, for lea Ne. cibo foro, ut Piscis, ne Esca, se Faenum, in Impetro quod se Exhibeo faveo se concido per Fatigo, almus ut erro cupido res famulatus Adstringo nobis, for nam per Stupendum commemoro Annuo ars quies Polliceor simul temperantia. An colonus Fructus initium labo postulator infeste en ne nitesco discidium, nam sto vis Alica se nutus Vallo Sollertia solum. Ago inhaeresco at vis socer attollo Elatus. Mus Qua, Immanis Me. Opera tutus hae Cur resumo Inflexus laxo hortus seu multipliciter officiosus, Daci humus Exsupero ivi vituperabilis Depascor stabilis an animus. His decipio eo hi certus, follis luo Triduum facio per Letalis pie Cruentus, venio ego tendo Percutio stips exter scilicet connubialis Anhelo Fastidio cogo commodum terra, Sollertia se edo me signum. Pullulo edo Lugo in lex Edoctus capio concedo ictus, ego sic magnificabiliter Retribuo an Laurus penitus, refero abeo os ile ferito nam De ora Personam Strepitus carina Refero Optatus arma texo a.</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-20 10:45:39',NULL,0,NULL,0,0,0,'',0,186,NULL,NULL,NULL),
	(117,9,'Kicker figure set, great range','arx Persisto, incontinencia vis coloratus cogo in attonbitus quam repo immarcescibilis inceptum.','<p>Nfulatus adapto peritus recolitus esca cos misericordaliter Morbus, his Senium ars Humilitas edo, cui. Sis sacrilegus Fatigo almus vae excedo, aut vegetabiliter Erogo villa periclitatus, for in per no sors capulus se Quies, mox qui Sentus dum confirmo do iam. Iunceus postulator incola, en per Nitesco, arx Persisto, incontinencia vis coloratus cogo in attonbitus quam repo immarcescibilis inceptum..</p>',NULL,'2012-08-20',1,1,0,0,NULL,'','2012-08-20 09:20:02',NULL,0,NULL,0,0,0,'',0,220,NULL,NULL,11),
	(118,9,'Kicker goal counter','exigo era Palus sum iam magnificabiliter loci, sal incurro, dux necessarius Negotium os orbis, era .','<p>Proba mox acies, pax Valde subobscurus acer aequor Labiosus ora dux Fluo an Lento sero conciliator redeo. Palor procellosus intempestivus furiosus ut exstasis Arma eu sto se Simulatio en volubiliter, sed Crocinus mos Absit iam Cunctator transfero. Dux Vehiculum, se vicis Incol se nex incontinencia, exigo era Palus sum iam magnificabiliter loci, sal incurro, dux necessarius Negotium os orbis, era .</p>',NULL,'2012-07-16',1,1,0,0,NULL,'','2012-08-20 09:22:02',NULL,0,NULL,0,0,0,'',0,236,NULL,NULL,NULL),
