	(223,14,'Alternative shipping costs','This shipping method is used whenever the default shipping method for the shopping cart configuration not available.','<p>This shipping method is used whenever the default shipping method for the shopping cart configuration not available. If, for example, the standard shipping method is configured to be used only for cart values up to 49 euros, the alternative shipping method can be configured to be automatically be used for carts with values over 50 euros.</p>',NULL,'2012-08-29',1,1,0,0,NULL,'','2012-08-30 15:27:05',NULL,0,NULL,0,0,0,'',0,780,NULL,NULL,35),
