INSERT INTO `s_articles_translations` (`id`, `articleID`, `languageID`, `name`, `keywords`, `description`, `description_long`, `description_clear`, `attr1`, `attr2`, `attr3`, `attr4`, `attr5`)
VALUES
	(13928,222,2,'Pillow - Flower','','Eo Opera Ora ullus Decolor, Caleo. Evolo cui patior, creptio quo debeo sus perspicax. Statim hoc sedo sui Erro do esca for delectatio evalesco cui ara almus ne interrogatio, contemno ruo internuntius. Statua Haec patria quo odio vos Illud ferox seputus lex Vergo, cadaver mos placet in os Volito. Quiane sesqui Ordo in aer Effusio qui non Santiago, ora for per Facio qua iam ara Plasmator rixa. Natu.','<p>Eo Opera Ora ullus Decolor, Caleo. Evolo cui patior, creptio quo debeo sus perspicax. Statim hoc sedo sui Erro do esca for delectatio evalesco cui ara almus ne interrogatio, contemno ruo internuntius. Statua Haec patria quo odio vos Illud ferox seputus lex Vergo, cadaver mos placet in os Volito. Quiane sesqui Ordo in aer Effusio qui non Santiago, ora for per Facio qua iam ara Plasmator rixa. Natu.</p>','','','','','',''),
	(13930,122,2,'','','','','','','','','',''),
	(13933,5,2,'Emmelkamp elder liqueur','','','<p>Ita si ardor laxe eu Cogo arx subaudio. Os, color attero, an. Hi inservio quatenus/quatinus, eu. Pax percunctor, ut. Me Mica. Ne, in plus neo pars ne navale quo Heniis varius, St. Iam vae ne inter Idem devenio parum accredo Neco nam byssus ales an Seu re is, mors vir incrementabiliter hio desisto Noxa chirographum eo, os, agon os nec lac enucleo his ile pes vos Suppellex, re. Vae libro corium Pul.</p>','','','','','',''),
	(13937,43,2,'Oil Change','','Ita si ardor laxe eu Cogo arx subaudio. Os, color attero, an. Hi inservio quatenus/quatinus, eu. Pax percunctor, ut. Me Mica.','<p>Ita si ardor laxe eu Cogo arx subaudio. Os, color attero, an. Hi inservio quatenus/quatinus, eu. Pax percunctor, ut. Me Mica. Ne, in plus neo pars ne navale quo Heniis varius, St. Iam vae ne inter Idem devenio parum accredo Neco nam byssus ales an Seu re is, mors vir incrementabiliter hio desisto Noxa chirographum eo, os, agon os nec lac enucleo his ile pes vos Suppellex, re. Vae libro corium Pul.</p>','','','','','',''),
