	(13955,228,2,'Payment methods & risk management','','In Shopware, you have different opportunities to handle the risk management','<p>In Shopware, you have different opportunities to handle the risk management. You can use them or other factors to define certain payment methods for certain customer groups.</p>\n<p>In this example, you are not offered the payment method \"invoice\" for instance\".</p>','','','','','',''),
	(13956,227,2,'Surcharge with payment methods','','In Shopware, you can define surcharges with desired payment methods','<p>In Shopware, you can define surcharges with desired payment methods. In this example we defined a surcharge of 5&nbsp; &euro; for the payment method \"invoice\"</p>','','','','','',''),
