	(13959,225,2,'Deco pillow Bird','','In hac alibi Pario nutus, Distinguo Barbare opto recidivus, iam tot do ruo volatilis Solito incompositus ','<p>In hac alibi Pario nutus, Distinguo Barbare opto recidivus, iam tot do ruo volatilis Solito incompositus perimo quicquid tergiversatio ops labruscum Trutino, studium superstes in parcus intorqueo eo. Iuvo ultor Facultas in insequor, mestitia veho hae Sui seu sic foras tam praecingo Accendo munero/munerior Tussis se similitudo Avus. Indigus per tumultus Terrenus iam Tam regno re pratum crystallinu.</p>','','','','','',''),
	(13960,221,2,'Shipping costs options','','Check out various configurations concerning the shipping costs setting.','<p>Check out various configurations concerning the shipping costs setting.</p>\n<p>Define standard shipping types, alternate shipping types, surcharge shipping types and more.</p>\n<p>You can also define shipping costs for weight, price, amot of articles and your own calculations.</p>','','','','','',''),
	(13961,220,2,'Article free of shipping costs','','You have the opportunity to ship an article free of shipping costs. All you have to do is selecting the field \"free of shipping costs\" in the article data overview. ','<p>You have the opportunity to ship an article free of shipping costs. All you have to do is selecting the field \"free of shipping costs\" in the article data overview.</p>\n<p>Add this article to you shopping cart an watch the result.</p>','','','','','',''),
	(13962,219,2,'Express shipping','','In Shopware , you have the opportunity to ship an article via express. This way, of cource, the customer is charged a higher fee. ','<p>In Shopware , you have the opportunity to ship an article via express. This way, of cource, the customer is charged a higher fee.</p>\n<p>To do so, you can choose between \"normal\" and \"express\" during the checkout process.<br /><br /></p>','','','','','',''),
	(13963,218,2,'','','Ichilominus Fultus ordior, ora Sterilis qua Se sum cum Conspicio sed Eo at ver oportet, filia cedo comprehendo baccatus','<p>Ichilominus Fultus ordior, ora Sterilis qua Se sum cum Conspicio sed Eo at ver oportet, filia cedo comprehendo baccatus. Sub Exortus mihi crastinus, per has frequentatio ivi vindico Salveo nutrimens seco Daci prepositus. Ne ora pax Bravium converto Translato, inter Species alimentum os incunabula. vis do aliger, oblittero livor Libet dis cruciamentum vaco nec re horrendus res diu item incrementab.</p>','','','','','',''),
	(13964,213,2,'Surf board','','Enego Do Loci his simul creta humilitas, Excello, se, sis ne fere Amotio turba excedo se res domito Villa, in, fundo novem, per qua tam Acer cornu. ','<p>Enego Do Loci his simul creta humilitas, Excello, se, sis ne fere Amotio turba excedo se res domito Villa, in, fundo novem, per qua tam Acer cornu. Prex niger qui os an calcar, has illi eu opinor eo Iuvenesco, ne mano se noceo, sto vere to Damno occludo, abortio pio os ago ictus imcomposite Vena subvenio, to evado Nitidus qua Immanis pollex, in tutus hae ac no laceratus, hi eo seu his. Laxo se fu.</p>','','','','','',''),
	(13965,211,2,'Bonus article with shopping cart value of over 250 Euro','','Your customers can either buy this article or get it as a free bonus article from a shopping cart value of over 250 Euros.','<p>Your customers can either buy this article or get it as a free bonus article from a shopping cart value of over 250 Euro.</p>\n<p>This function needs to be activated in your backend under Conficuration --&gt; Storefront</p>','','','','','',''),
	(13967,210,2,'Bonus article with shopping cart value of over 50 Euro','','Your customers can either buy this article or get it as a free bonus article from a shopping cart value of over 250 Euros.','<p>Your customers can either buy this article or get it as a free bonus article from a shopping cart value of over 50 Euro.</p>\n<p>This function needs to be activated in your backend under Conficuration --&gt; Storefront</p>','','','','','',''),
