	(3,'Der Sommer wird bunt',NULL,1,'Diesen Sommer heit es Mut zur Farbe. Denn knallbunte Kleidungsstcke sind der absolute Renner bei stilbewussten Frauen. Egal ob zitronengelbes Top, grasgrne Chinohose oder pinke Clutch - Damit werden Sie auf jeden Fall ein Blickfang sein. Und dieses Jahr gehen wir sogar noch einen Schritt weiter. ','<div class=\"description\">\n<p>Diesen Sommer hei&szlig;t es &bdquo;Mut zur Farbe&ldquo;. Denn knallbunte Kleidungsst&uuml;cke sind der absolute Renner bei stilbewussten Frauen. Egal ob zitronengelbes Top, grasgr&uuml;ne Chinohose oder pinke Clutch - Damit werden Sie auf jeden Fall ein Blickfang sein. Und dieses Jahr gehen wir sogar noch einen Schritt weiter.</p>\n<p>Was zuvor ein absoluter Stilbruch war, ist jetzt Trend: Colour Blocking. Das Kombinieren von strahlenden und bunten Farben, die jeder Frau einen dynamischen und selbstbewussten Look verleihen. Und dabei k&ouml;nnen Sie kaum etwas falsch machen. Schauen Sie einfach, welche Farbe Ihrem Typ entspricht und in welcher Sie sich wohlf&uuml;hlen. Den gr&ouml;&szlig;ten Effekt erzielen Sie durch kontr&auml;re Farben mit der gleichen Intensit&auml;t. Zudem sollten die Kleidungsst&uuml;cke von der Form einfach und klassisch sein. Ansonsten sind Ihnen beim Colour Blocking keine Grenzen gesetzt. Je gewagter, desto besser. Und nach dem Trend k&ouml;nnen Sie einfach einzelne Kleidungsst&uuml;cke als Basic weiternutzen.</p>\n<p>Versuchen Sie es selbst! Denn mit knallbunten Farben ist gute Laune vorprogrammiert!</p>\n<p>Viel Spa&szlig; w&uuml;nscht Ihnen das Team der shopware AG.</p>\n</div>',1,'2012-08-22 11:00:00',17,'','','',NULL),
	(4,'Sonnenschutz - so gehren Sie zur Crme de la Crme',NULL,1,'Sonnencreme richtig auftragen  Darauf mssen Sie achten\n\nStrand , Meer und Sonne - Genieen Sie auch den Sommer? Das hoffen wir natrlich! Doch Vorsicht: Jeder Urlaub ist in Gefahr, wenn Sie nach dem Sonnenbaden feststellen, dass Ihre Haut spannt und gertet ist. Die Rede ist natrlich von einem fiesen und schmerzhaften Sonnenbrand. ','<div class=\"description\">\n<p><span style=\"font-size: small;\"><strong><span style=\"text-decoration: underline;\">Sonnencreme richtig auftragen &ndash; Darauf m&uuml;ssen Sie achten</span></strong></span></p>\n<br />\n<p><span style=\"font-size: small;\">Strand , Meer und Sonne - Genie&szlig;en Sie auch den Sommer? Das hoffen wir nat&uuml;rlich! Doch Vorsicht: Jeder Urlaub ist in Gefahr, wenn Sie nach dem Sonnenbaden feststellen, dass Ihre Haut spannt und ger&ouml;tet ist. Die Rede ist nat&uuml;rlich von einem fiesen und schmerzhaften Sonnenbrand.</span></p>\n<br />\n<p><span style=\"font-size: small;\">Eine unliebsame Erfahrung , insbesondere weil die Haut einen Sonnenbrand niemals vergisst. Denn bei Verbrennungen wird nicht nur die oberste Haftschicht verbrannt, sondern auch die tiefer liegenden Hautschichten. Dadurch steigt das Risiko von Hautkrebs um ein Vielfaches, und die Haut altert schneller. Cremen Sie sich deshalb immer sch&ouml;n mit Sonnencreme ein und beherzigen Sie folgende Tipps:</span></p>\n<br />\n<p><span style=\"font-size: small;\">Tragen Sie die Sonnencreme gro&szlig;z&uuml;gig auf. Denn erst ab einer gewissen Menge pro Quadratzentimeter Haut wird ein ausreichender</span> Sonnenschutz<span style=\"font-size: small;\"> gew&auml;hrleistet. Vergessen Sie dabei m&ouml;glichst keine K&ouml;rperstelle, denn auch Sonnenbr&auml;nde auf Ohrl&auml;ppchen, Scheitel etc. sind gef&auml;hrlich.</span></p>\n<br />\n<p><span style=\"font-size: small;\">Um einen maximalen Schutz zu gew&auml;hrleisten, sollten Sie die Sonnencreme 15-30 Minuten einwirken lassen, bevor Sie sich in die Sonne begeben. Cremen Sie sich in regelm&auml;&szlig;igen Abst&auml;nden ein und erneuern Sie somit Ihren Sonnenschutz. Dies sollte mindestens alle zwei Stunden passieren. Insbesondere beim abrubbeln nach dem Baden geht der Schutz verloren. Deshalb: Nachcremen nicht vergessen.</span></p>\n<br />\n<p><span style=\"font-size: small;\">Wir w&uuml;nschen Ihnen sonnenbrandfreien Sommer!</span></p>\n</div>',NULL,'2012-08-18 08:00:00',17,'','','',NULL),
	(5,'Ich packe meinen Koffer',NULL,1,'Der Urlaub ist die schnste Zeit im Jahr. Ob Sonne, Strand und Meer oder wandern im Gebirge - Es soll eine schne und erholsame Zeit mit der Familie oder dem Partner werden. Damit diese nicht zum Albtraum wird und die Vorbereitungen nicht in puren Stress ausarten, sollten rechtzeitig einige Vorkehrungen getroffen werden. Ganz nach dem Motto: So wie du dich vorbereitest, wird deine weitere Reise sein. ','<div class=\"description\">\n<p>Der Urlaub ist die sch&ouml;nste Zeit im Jahr. Ob Sonne, Strand und Meer oder wandern im Gebirge - Es soll eine sch&ouml;ne und erholsame Zeit mit der Familie oder dem Partner werden. Damit diese nicht zum Albtraum wird und die Vorbereitungen nicht in puren Stress ausarten, sollten rechtzeitig einige Vorkehrungen getroffen werden. Ganz nach dem Motto: &bdquo;So wie du dich vorbereitest, wird deine weitere Reise sein.&ldquo;</p>\n<p>Machen Sie sich deshalb vor Reiseantritt mit den Einreisebestimmungen des jeweiligen Urlaubsziels vertraut. Denn jedes Land hat seine Eigenheiten. In diesem Zuge pr&uuml;fen Sie, ob Ihr Personalausweis oder Ihr Pass g&uuml;ltig ist. F&uuml;r viele L&auml;nder gilt n&auml;mlich, dass der Pass zum Zeitpunkt der Reise noch mindestens 6 Monate g&uuml;ltig sein muss. Falls Sie zudem geplant hatten, ein Auto zu mieten, denken Sie daran, sich einen internationalen F&uuml;hrerschein bei Ihrem Stra&szlig;enverkehrsamt ausstellen zu lassen.</p>\n<p>Beugen Sie aktiv Gesundheitsrisiken vor, indem Sie sich zum Thema Reisemedizin Ihres Urlaubsziels informieren. Gegebenenfalls m&uuml;ssen Impfungen aufgefrischt werden. Informieren Sie sich rechtzeitig darum, da einige Impfungen &uuml;ber einen l&auml;ngeren Zeitraum verabreicht werden m&uuml;ssen. Au&szlig;erdem sollten Sie eine Auslandskrankenversicherung abschlie&szlig;en, denn schon ein Zahnarztbesuch kann Ihnen in einigen L&auml;ndern teuer zu stehen kommen. Au&szlig;erdem ist es immer vorteilhaft, eine kleine Reiseapotheke mit reisetypischen Medikamenten im Koffer dabei zu haben.</p>\n<p>Tauschen Sie schon vor dem Urlaub nur kleinere Geldbetr&auml;ge um. Denn h&auml;ufig ist es g&uuml;nstiger, den Rest vor Ort aufgrund von g&uuml;nstigeren Wechselkursen umzutauschen.</p>\n<p>Damit an alles gedacht wird, erstellen Sie eine gute, alte Urlaubs-Checkliste. Somit wird nichts mehr vergessen. Im Internet finden Sie dazu mittlerweile zahlreiche praktische Listen zum Abhaken, egal ob f&uuml;r den Sommer- oder Winterurlaub.</p>\n<p>Wir w&uuml;nschen Ihnen einen sonnigen und erholsamen Urlaub. Sie haben Ihn sich verdient!</p>\n</div>',NULL,'2012-08-08 07:00:00',17,'','','',NULL),
	(6,'The summer will be colorful',NULL,1,'This summer is going to be colorful. Brightly colored clothes are the must-have for every style-conscious woman.','<p>This summer is going to be colorful. Brightly colored clothes are the must-have for every style-conscious woman. Whether lemon-yellow top, grass-green chinos or pink clutch &ndash; with these colors you will definitely be an eye catcher. And this year we even go one step further.</p>\n<p>What used to be a no-go is now a trend: The key word is &ldquo;color blocking&rdquo;. Combining glowing and bright colors gives every woman a dynamic and confident look. And you can hardly go wrong. Just look what color suits your type and which you like best. The greatest effect can be achieved by contrasting colors with the same intensity. In addition, the forms of the garments should be kept simple and classic. Otherwise, no limits are set to color blocking. The more daring, the better. And after the trend, you can simply continue to use individual pieces of clothing as basics.</p>\n<p>Try it out now! Wearing bright colors, good mood is guaranteed!</p>\n<p>Enjoy the summer!</p>',2,'2012-06-01 11:00:00',42,'','','',NULL),
	(7,'Sun cream - Be part of the crme de la crme',NULL,1,'Beach, sea and sun - Do you also enjoy the summer? We hope so! But beware: Every holiday is in danger when you notice that your skin is stretched and reddened after a long sun bath','<p><span style=\"text-decoration: underline;\">How to put on sun cream properly </span></p>\n<p>Beach, sea and sun - Do you also enjoy the summer? We hope so! But beware: Every holiday is in danger when you notice that your skin is stretched and reddened after a long sun bath. Yes, we are talking about painful sunburn.</p>\n<p>An unpleasant experience, especially because your skin will never forget sunburn. Due to burns not only the top layer is afected, but also the underlying layers of your skins. This increases the risk of skin cancer immensely, and the skin starts aging faster. Therefore you are always supposed to put on sun cream and heed the following tips:</p>\n<p>Put on sunscreen generously. Only a certain amount per square can ensure a sufficient sun protection for your skin. Moreover, you should never miss parts of your body. Then sunburn can be even painful and harmful on earlobes and feet.</p>\n<p>To ensure maximum protection, you should leave the sun cream on at least 15-30 minutes before going out in the sun. Put on some lotion in regular intervals and thus refresh your sunscreen every two hours. Especially after a bath the protection is usually lost.</p>\n<p>Therefore: Do not forget to put on suncream!</p>\n<p>We wish you a sunburn-free summer!</p>',1,'2012-06-01 08:00:00',42,'','','',NULL);
