	(5,3,'|3|','Genusswelten',0,0,0,0,'2012-08-15 15:48:04','2012-08-15 15:48:04',NULL,'','Genusswelten','<p>Ivi praebalteata Occumbo congruens seco, lea qui se surculus sed abhinc praejudico in forix curo. Sui aut hoc refectorium celo hos iam Upilio Ars retineo etsi lac damnatio imcomposite for oneratus sacrificum ora navigatio. St incultus Vox inennarabilis ludo per dis misericordaliter Summitto cos Infectum per velut scaccarium abico, inconsolabilis Occasus. Ipse Succumbo, Accumulo cui supellectilis Cogitatio contumelia fama quadruplator. Per sol insequor prex his arx necessarius Primordia De cum casa fiducialiter laboriosus Secundus, lex asper ros hio cur interrogatio saltem vir Adversa, Gregatim mei Eo metuo sum maro iam proclivia amicabiliter occulto cruor fleo peto delitesco Comperte lacerta his tot Os ut Fruor res Gaza provisio conscientia dux effrenus Promus sui secundus rutila. Celo nam balnearius Opprimo Pennatus, no decentia sui, dicto esse se pulchritudo, pupa Sive res indifferenter. Captivo pala pro de tandem Singulus labor, determino cui Ingurgito quo Ico pax ethologus praet.</p>','article_listing_1col.tpl',0,1,0,1,'',0,0,NULL),
	(6,3,'|3|','Sommerwelten',3,0,0,0,'2012-08-15 15:48:54','2012-08-15 15:48:54',NULL,'','Sommerwelten','<p>O. Ruo in divortium ita sesquimellesimus Oppono plus celo sceptrum, res ingustatus hi Ango prae tum quatenus/quatinus Sumptus per Avoco nos Indulgens mei heu cur Baiulus attonitus. Via subterfugio radio hac castra, tui Seorsum tam Byssus ex infirmitas. Cum illi organum archidictus, aedificium aut Exsilio neo, pie Promus finis ingenium luo Penna iocus curo Agnellus divinus. Ut ops gero ops Adsumo .</p>','article_listing_4col.tpl',0,1,0,1,'',0,0,NULL),
	(8,3,'|3|','Wohnwelten',2,0,0,0,'2012-08-15 15:49:31','2012-08-15 15:49:31',NULL,'','Wohnwelten','<p>O. Ruo in divortium ita sesquimellesimus Oppono plus celo sceptrum, res ingustatus hi Ango prae tum quatenus/quatinus Sumptus per Avoco nos Indulgens mei heu cur Baiulus attonitus. Via subterfugio radio hac castra, tui Seorsum tam Byssus ex infirmitas. Cum illi organum archidictus, aedificium aut Exsilio neo, pie Promus finis ingenium luo Penna iocus curo Agnellus divinus. Ut ops gero ops Adsumo .</p>','article_listing_4col.tpl',0,1,0,1,'',0,0,NULL),
	(9,3,'|3|','Freizeitwelten',1,0,0,0,'2012-08-15 15:50:39','2012-08-15 15:50:39',NULL,'','Freizeitwelten','<p>Nfrunitus, inconcussus Rogo eo non Namucense, commissum, laureatus Scutum, de boo si anhelo Commoneo procellosus sono emitto Crimen agna. Si subo Accubo castimonia hic ibi qua lux sto eu Pulcher Sem. Dis Cubiculum quo scitus Litigo diripio ango quies pes res penitentia Tabula, vos diu Sordes vae Epulor ile Tenor, nox Opulentia diu, ago Suppono sto pia Erilis, hae Virgo iam ora. Nam constat Lues h.</p>','',0,1,0,1,'',0,0,NULL),
	(10,3,'|3|','Beispiele',4,0,0,0,'2012-08-15 15:50:50','2012-08-15 15:50:50',NULL,'','Beispiele','<p>Ed praesidium perspicax Prodoceo cotidie. Leo tam pro, aut dux tui Pluo hic tu ait vis proterus. Ubi consonum venor, sum incommendatus Generasco pumilius Ferme, Profectus nos dissemino, aer quibus demum intellectus senior carrus. Sus repecto nam familia hoc cado pax aut vindico tamdiu. Exaro dictator Quatenus quo pallium cum Ceterum fore hi ait ops Duo. Ops Quamobrem Affinitas natu tener baro, pe.</p>','',0,1,0,1,'',0,0,NULL),
	(11,5,'|5|3|','Tees und Zubehr',0,0,0,0,'2012-08-16 12:24:02','2012-08-16 12:24:02',NULL,'','Tees und Zubehr','<p>X per ferme pellis nos cito aer Quibus. Cras huic Quod ango sus no Oculus fio indigus amo pica aut Vulgus Sal emineo. Se, per Series In cum ceterum hac martyr Aula Opto, an Prodoceo par Verber In ruo crapula recito Res tellus In duco mel iuro laboro os, do Cos Luna dono ter horum, for res iuxta Patulum ira, tam hoc qui for se ait. Tam suo nam sono eximo ars, sub Crispus alveus. Una, vae hic latex.</p>','article_listing_3col.tpl',0,1,0,1,'',0,0,NULL),
	(12,11,'|11|5|3|','Tees',0,0,0,0,'2012-08-16 12:37:19','2012-08-16 12:37:19',NULL,'','Tees','<p>Nos districtus delinquentes sesquioctavus cras hoc silva Concedo, abeo repere nam Familia lignarius cado sesquimellesimus Se, volo tergo duco Dictator per Socus.</p>','article_listing_2col.tpl',0,1,0,1,'',0,0,NULL),
	(13,11,'|11|5|3|','Tee-Zubehr',1,0,0,0,'2012-08-16 12:37:32','2012-08-16 12:37:32',NULL,'','Tee-Zubehr','<p>Do, cum Murus, re in munita, opto ala leo Certamen spoliatio, curvo Exemplar annecto per hic commorantes, ater ut poema Basilice, sic Venor acer caballus, incommoditas Propero exacuo palus.&nbsp;</p>','article_listing_1col.tpl',0,1,0,1,'',0,0,NULL),
	(14,5,'|5|3|','Edelbrnde',1,0,0,0,'2012-08-16 16:52:19','2012-08-16 16:52:19',NULL,'','Die besten Edelbrnde','','article_listing_1col.tpl',0,1,0,1,'',0,0,NULL),
	(15,5,'|5|3|','Kstlichkeiten',2,0,0,0,'2012-08-17 08:58:56','2012-08-17 08:58:56',NULL,'','Kstlichkeiten','<p>O curriculum Paene tum lea aut plane Subdo eia Permetior luxuria. Se Velamen ora advoco.Sem Ferreus, pax sis Faenum incumbo lux Advoco alea crimen, provida amita boo illis quatenus/quatinus Tandem, Sanctus lex ratio, per Vobis latrocinium queo tergum Varietas lea hic Fero at Fides prae festinanter lacer. Mugio universitas magnificentia contente St incogito Mire to aut ut Avunculus do specialitas,.</p>','article_listing_2col.tpl',0,1,0,1,'',0,0,NULL),
	(16,9,'|9|3|','Entertainment',1,0,0,0,'2012-08-17 12:19:25','2012-08-17 12:19:25',NULL,'','','','article_listing_2col.tpl',0,1,0,1,'',0,0,NULL),
	(17,3,'|3|','Trends + News',5,0,0,0,'2012-08-18 18:22:16','2012-08-18 18:22:16',NULL,'','Blogfunktion','<p>Weblogs sind heutzutage ein sehr popul&auml;res Kommunikationsmedium, um regelm&auml;&szlig;ig Informationen zu ver&ouml;ffentlichen. Das neue Blog-System in Shopware 4 kombiniert die Vorteile von modernen Weblogs mit dem eigenen Onlineshop. So k&ouml;nnen etwa Produktneuheiten, News aus dem Unternehmen und vieles mehr direkt im Shop mitgeteilt und mit Produkten sinnvoll verkn&uuml;pft werden.</p>\n<p>Mehr noch, ist der shopeigene Blog eine schon fast nicht mehr wegzudenkende Option, das Suchmaschinen-Ranking durch relevante Texte und Bilder zu verbessern. Das neue Blog-System in Shopware 4 bietet neben einem neuen Design mehr Funktionen und eine verbesserte Usability.&nbsp;</p>','',0,1,1,1,'',0,0,NULL),
	(19,10,'|10|3|','Crossselling',6,0,0,0,'2012-08-20 12:46:24','2012-08-20 12:46:24',NULL,'','Crossselling','<p>Um dem Kunden das Einkaufen so einfach und komfortabel wie m&ouml;glich zu gestalten, k&ouml;nnen unter Cross-Selling direkte Verkn&uuml;pfungen zu anderen Artikeln eingerichtet werden.</p>\n<p>Hierbei k&ouml;nnen Sie <strong>&Auml;hnliche Artikel</strong> und auch <strong>Artikel-Zubeh&ouml;r</strong> zum jeweiligen Artikel vorschlagen.</p>','article_listing_2col.tpl',0,1,0,1,'',0,0,NULL),
	(20,10,'|10|3|','Darstellung',5,0,0,0,'2012-08-20 12:46:28','2012-08-20 12:46:28',NULL,'','Artikeldarstellung im Listing.','<p>Shopware bietet Ihnen vielf&auml;ltige M&ouml;glichkeiten zur Darstellung der Artikel in der Artikel&uuml;bersicht. So k&ouml;nnen Sie ganz einfach bestimmte Artikel&nbsp;als Highlight,&nbsp;bewertete Artikel,&nbsp;neue Artikel anzeigen lassen. Zudem werden Downloadartikel auch automatisch gekennzeichnet.</p>','article_listing_1col.tpl',0,1,0,1,'',0,0,NULL),
	(21,10,'|10|3|','Produktvergleiche & Filter',4,0,0,0,'2012-08-20 12:46:42','2012-08-20 12:46:42',NULL,'','Eigenschaften und Filter','<p><span style=\"text-decoration: underline;\"><strong>Eigenschaften /Filter</strong></span><br />Den Artikeln in dieser Kategorie wurden mehrere Eigenschaften zugeordnet. Sobald Eigenschaften hinterlegt wurden erscheinen diese in der Storefront in der linken Spalte unter den Kategorien und k&ouml;nnen dort gefiltert werden.<br /><br /><span style=\"text-decoration: underline;\"><strong>Produktvergleich</strong></span><br />Die hinterlegten Eigenschaften erm&ouml;glichen Ihrem Kunden zudem den einfachen Produktvergleich zwischen den Artikeln. W&auml;hlen Sie hierf&uuml;r bei den gew&uuml;nschten Artikel die Option \"Vergleichen\". Im Anschluss k&ouml;nnen Sie den Vergleich im Header (oben im Shop) starten.</p>','article_listing_2col.tpl',0,1,0,1,'',0,0,NULL),
	(22,10,'|10|3|','Konfiguratorartikel',2,0,0,0,'2012-08-20 12:47:21','2012-08-20 12:47:21',NULL,'','Das Plugin Artikelkonfigurator','<p>Mit dem im Standard enthaltenen Plugin Artikel-Konfigurator haben Sie die M&ouml;glichkeit, mehrdimensionale Varianten anzulegen. Diese sind notwendig, wenn sich ein Artikel in mehr als einer Eigenschaft von seinen Varianten unterscheidet. Dies kann, wie in diesem Beispiel, ein paar Schuhe / Sandalen sein, die sich in Gr&ouml;&szlig;e und Farbe unterscheiden. Sie haben die M&ouml;glichkeit, vier verschiedene Arten des Konfigurators zu w&auml;hlen. Jede Art hat Ihre Besonderheit.</p>','article_listing_1col.tpl',0,1,0,1,'',0,0,NULL),
	(23,10,'|10|3|','Preisgestaltung',10,0,0,0,'2012-08-20 12:47:29','2012-08-20 12:47:29',NULL,'','Mglichkeiten der Preisgestaltung','<p>Sie haben bei der Preisgestaltung vielf&auml;ltige M&ouml;glichkeiten, so kann man Grundpreise angeben, dem Kunden Staffelpreise anbieten oder auch die Ersparnis zum ehemaligen Preis durch den Pseudopreis aufzeigen. Genauso k&ouml;nnen Verpackungseinheiten sowie Mindest- und Maximalabnahmemengen festgelegt werden.</p>','article_listing_1col.tpl',0,1,0,1,'',0,0,NULL),
	(24,10,'|10|3|','Versandkosten',9,0,0,0,'2012-08-20 12:47:35','2012-08-20 12:47:35',NULL,'','Versandkosteneinstellungen','<p>Mit dem Versandkosten Modul erm&ouml;glicht Shopware Ihnen eine Vielzahl von Einstellungsm&ouml;glichkeiten um neben dem Standardversand auch einen Expressversand und auch einen Versand ins Ausland anzubieten.</p>','article_listing_1col.tpl',0,1,0,1,'',0,0,NULL),
	(25,10,'|10|3|','Zahlungsarten',8,0,0,0,'2012-08-20 12:47:55','2012-08-20 12:47:55',NULL,'','Zahlungsarten & Riskmanagement','<p>Shopware stellt Ihnen verschiedenste M&ouml;glichkeiten bereit um Aufschl&auml;ge oder Abschl&auml;ge f&uuml;r Zahlungsarten zu definieren. Zudem kann &uuml;ber das Riskmanagement k&ouml;nnen Sie f&uuml;r die Minimierung von Zahlungsausf&auml;llen ein effektives Regelwerk bereitstellen.</p>','article_listing_1col.tpl',0,1,0,1,'',0,0,NULL),
	(27,10,'|10|3|','In Krze verfgbar',0,0,0,0,'2012-08-20 12:55:26','2012-08-20 12:55:26',NULL,'','In Krze verfgbar','<p>In K&uuml;rze werden wir vier neue Premium Plugins anbieten</p>','',0,1,0,1,'',0,0,NULL),
	(30,10,'|10|3|','Kundenbindung',3,0,0,0,'2012-08-22 15:48:47','2012-08-22 15:48:47',NULL,'','Funktionen zur Kundenbindung','<p>Damit Neukunden auch zu Stammkunden werden sind, neben vielen Faktoren wie der Usability und der Performance, auch noch verschiedene Faktoren zur Kundenbindung wichtig. Damit Sie dauerhaft Stammkunden zu Ihrer Kundschaft zhlen knnen, gibt es die Mglichkeiten mit dem Bonus-System dem Kunden Bonuspunkte fr jeden Euro Einkaufswert anzubieten. Zudem knnen im Warenkorb auch ab bestimmten Warenkorbwerten Prmienartikel angeboten werden, die der Kunde kostenfrei hinzu bestellen kann.</p><p>In Shopware knnen Sie Kunden durch verschiedene Gutscheinfunktionen Ihre Kunden zu einem Kaufabschluss bringen. Shopware bietet Ihnen umfangreiche Gutscheinfunktionen, die Sie testen knnen, indem Sie z.B. einen der folgenden vordefinierten Gutscheine einmal einlsen. Tragen Sie dazu einfach den fett gedruckten Begriff in das Gutscheinfeld direkt im Warenkorb ein:\'<br><br>- \"<strong>kostenfrei</strong>\"&nbsp;<br>(Gutschein fr einen kostenfreien Versand)<br>- \"<strong>absolut</strong>\"&nbsp;<br>(allgemeingltiger Gutschein fr einen Nachlass von 5 EUR ab einem Umsatz von 25 EUR)&nbsp;<br>- \"<strong>prozentual</strong>\"&nbsp;<br>(allgemeingltiger Gutschein fr einen Nachlass von 10% des Warenkorbwertes)</p><p>Darber hinaus knnen Sie auch mit individuellen Gutscheincodes arbeiten. Wir haben Ihnen dazu einen Gutschein vorbereitet, dem bereits mehrere individuelle Codes zugeordnet sind. Sie knnen die jeweiligen Codes unter \"Marketing &gt; Gutscheine &gt; Gutschein (individuell)\" abfragen. Bei diesem Gutschein ist ein Abzug von 15 EUR ab einem Bestellwert von 50 EUR hinterlegt.</p>','article_listing_1col.tpl',0,1,0,1,'',0,0,NULL),
	(31,9,'|9|3|','Vintage',0,0,0,0,'2012-08-29 11:12:37','2012-08-29 11:12:37',NULL,'','','','article_listing_2col.tpl',0,1,0,1,'',0,0,NULL),
