	(959,253,'esdDownloadStrategy','i:1;','Downloadoption fr ESD Dateien','<b>Achtung</b>: Diese Einstellung knnte die Funktionalitt der ESD Downloads beeintrchtigen. ndern Sie hier nur die Einstellung falls Sie wissen, was Sie tun.<br><br>Downloadstrategie fr ESD Dateien.<br><b>Link</b>: Unter umstnden Unsicher, da der Link von Auen eingesehen werden kann.<br><b>PHP</b>: Der Link kann nicht eingesehen werden. PHP liefert die Datei aus. Dies kann zu Problemen bei greren Dateien fhren.<br><b>X-Sendfile</b>: Untersttz grere Dateien und ist sicher. Bentigt das X-Sendfile Apache Module. <br><b>X-Accel</b>: quivalent zum X-Sendfile. Bentigt das Nginx Modul X-Accel.','select',1,4,0,NULL,NULL,X''),
