INSERT INTO `s_core_translations` (`id`, `objecttype`, `objectdata`, `objectkey`, `objectlanguage`)
VALUES
	(58,'config_payment','a:5:{i:4;a:2:{s:11:\"description\";s:8:\"Rechnung\";s:21:\"additionalDescription\";s:210:\"Sie zahlen einfach und bequem auf Rechnung. Shopware bietet z.B. auch die Mglichkeit, Rechnung automatisiert erst ab der 2. Bestellung fr Kunden zur Verfgung zu stellen, um Zahlungsausflle zu vermeiden.\";}i:2;a:2:{s:11:\"description\";s:11:\"Lastschrift\";s:21:\"additionalDescription\";s:10:\"Zusatztext\";}i:3;a:2:{s:11:\"description\";s:9:\"Nachnahme\";s:21:\"additionalDescription\";s:36:\"(zzgl. 2,00 Euro Nachnahmegebhren)\";}i:5;a:2:{s:11:\"description\";s:8:\"Vorkasse\";s:21:\"additionalDescription\";s:108:\"Sie zahlen einfach vorab und erhalten die Ware bequem und gnstig bei Zahlungseingang nach Hause geliefert.\";}i:6;a:2:{s:11:\"description\";s:4:\"SEPA\";s:21:\"additionalDescription\";s:16:\"SEPA Lastschrift\";}}',1,'2'),
	(60,'config_mails','a:2:{s:7:\"subject\";s:57:\"Statusnderung zur Bestellung bei {config name=shopName}\";s:7:\"content\";s:362:\"Sehr geehrte{if $sUser.billing_salutation eq \"mr\"}r Herr{elseif $sUser.billing_salutation eq \"ms\"}Frau{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n\nDer Status Ihrer Bestellung mit der Bestellnummer: {$sOrder.ordernumber} vom {$sOrder.ordertime|date_format:\" %d-%m-%Y\"} hat sich gendert. \n\nDer neue Status lautet nun {$sOrder.status_description}.\";}',23,'2'),
	(61,'config_mails','a:4:{s:8:\"fromMail\";s:16:\"{$sConfig.sMAIL}\";s:8:\"fromName\";s:20:\"{$sConfig.sSHOPNAME}\";s:7:\"subject\";s:57:\"Statusnderung zur Bestellung bei {config name=shopName}\";s:7:\"content\";s:362:\"Sehr geehrte{if $sUser.billing_salutation eq \"mr\"}r Herr{elseif $sUser.billing_salutation eq \"ms\"}Frau{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n\nDer Status Ihrer Bestellung mit der Bestellnummer: {$sOrder.ordernumber} vom {$sOrder.ordertime|date_format:\" %d-%m-%Y\"} hat sich gendert. \n\nDer neue Status lautet nun {$sOrder.status_description}.\";}',14,'2'),
	(62,'config_mails','a:2:{s:7:\"subject\";s:57:\"Statusnderung zur Bestellung bei {config name=shopName}\";s:7:\"content\";s:672:\"Hallo {if $sUser.billing_salutation eq \"mr\"}Herr{elseif $sUser.billing_salutation eq \"ms\"}Frau{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n \nder Bestellstatus fr Ihre Bestellung {$sOrder.ordernumber} hat sich gendert!\nDie Bestellung hat jetzt den Status: {$sOrder.status_description}.\n\nDen aktuellen Status Ihrer Bestellung  knnen Sie  auch jederzeit auf unserer Webseite im  Bereich \"Mein Konto\" - \"Meine Bestellungen\" abrufen. Sollten Sie allerdings den Kauf ohne Registrierung, also ohne Anlage eines Kundenkontos, gewhlt haben, steht Ihnen diese Mglichkeit nicht zur Verfgung.\n \nMit freundlichen Gren,\nIhr Team von {config name=shopName}\";}',30,'2'),
	(63,'config_mails','a:2:{s:7:\"subject\";s:57:\"Statusnderung zur Bestellung bei {config name=shopName}\";s:7:\"content\";s:362:\"Sehr geehrte{if $sUser.billing_salutation eq \"mr\"}r Herr{elseif $sUser.billing_salutation eq \"ms\"}Frau{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n\nDer Status Ihrer Bestellung mit der Bestellnummer: {$sOrder.ordernumber} vom {$sOrder.ordertime|date_format:\" %d-%m-%Y\"} hat sich gendert. \n\nDer neue Status lautet nun {$sOrder.status_description}.\";}',15,'2'),
	(64,'config_mails','a:2:{s:7:\"subject\";s:57:\"Statusnderung zur Bestellung bei {config name=shopName}\";s:7:\"content\";s:672:\"Hallo {if $sUser.billing_salutation eq \"mr\"}Herr{elseif $sUser.billing_salutation eq \"ms\"}Frau{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n \nder Bestellstatus fr Ihre Bestellung {$sOrder.ordernumber} hat sich gendert!\nDie Bestellung hat jetzt den Status: {$sOrder.status_description}.\n\nDen aktuellen Status Ihrer Bestellung  knnen Sie  auch jederzeit auf unserer Webseite im  Bereich \"Mein Konto\" - \"Meine Bestellungen\" abrufen. Sollten Sie allerdings den Kauf ohne Registrierung, also ohne Anlage eines Kundenkontos, gewhlt haben, steht Ihnen diese Mglichkeit nicht zur Verfgung.\n \nMit freundlichen Gren,\nIhr Team von {config name=shopName}\";}',33,'2'),
	(65,'config_mails','a:2:{s:7:\"subject\";s:48:\"Change of order status in {config name=shopName}\";s:7:\"content\";s:987:\"Sehr geehrte{if $sUser.billing_salutation eq \"mr\"}r Herr{elseif $sUser.billing_salutation eq \"ms\"} Frau{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n \nDer Status Ihrer Bestellung mit der Bestellnummer {$sOrder.ordernumber} vom {$sOrder.ordertime|date_format:\" %d.%m.%Y\"} \nhat sich gendert. Der neue Staus lautet nun \"{$sOrder.status_description}\".\n \n \nInformationen zu Ihrer Bestellung:\n================================== \n{foreach item=details key=position from=$sOrderDetails}\n{$position+1|fill:3} {$details.articleordernumber|fill:10:\" \":\"...\"} {$details.name|fill:30} {$details.quantity} x {$details.price|string_format:\"%.2f\"} {$sConfig.sCURRENCY}\n{/foreach}\n \nVersandkosten: {$sOrder.invoice_shipping} {$sConfig.sCURRENCY}\nNetto-Gesamt: {$sOrder.invoice_amount_net|string_format:\"%.2f\"} {$sConfig.sCURRENCY}\nGesamtbetrag inkl. MwSt.: {$sOrder.invoice_amount|string_format:\"%.2f\"} {$sConfig.sCURRENCY}\n \nMit freundlichen Gren,\nIhr Team von {config name=shopName}\";}',31,'2'),
	(66,'config_mails','a:2:{s:7:\"subject\";s:57:\"Statusnderung zur Bestellung bei {config name=shopName}\";s:7:\"content\";s:672:\"Hallo {if $sUser.billing_salutation eq \"mr\"}Herr{elseif $sUser.billing_salutation eq \"ms\"}Frau{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n \nder Bestellstatus fr Ihre Bestellung {$sOrder.ordernumber} hat sich gendert!\nDie Bestellung hat jetzt den Status: {$sOrder.status_description}.\n\nDen aktuellen Status Ihrer Bestellung  knnen Sie  auch jederzeit auf unserer Webseite im  Bereich \"Mein Konto\" - \"Meine Bestellungen\" abrufen. Sollten Sie allerdings den Kauf ohne Registrierung, also ohne Anlage eines Kundenkontos, gewhlt haben, steht Ihnen diese Mglichkeit nicht zur Verfgung.\n \nMit freundlichen Gren,\nIhr Team von {config name=shopName}\";}',34,'2'),
	(67,'config_mails','a:2:{s:7:\"subject\";s:57:\"Statusnderung zur Bestellung bei {config name=shopName}\";s:7:\"content\";s:426:\"Sehr geehrte{if $sUser.billing_salutation eq \"mr\"}r Herr{elseif $sUser.billing_salutation eq \"ms\"}Frau{/if} \n{$sUser.billing_firstname} {$sUser.billing_lastname},\n \nDer Status Ihrer Bestellung mit der Bestellnummer {$sOrder.ordernumber} vom {$sOrder.ordertime|date_format:\" %d.%m.%Y\"} \nhat sich gendert. Der neun Staus lautet nun {$sOrder.status_description}.\n \nMit freundlichen Gren,\nIhr Team von {config name=shopName}\";}',29,'2'),
	(68,'config_mails','a:3:{s:7:\"subject\";s:22:\"SEPA Lastschriftmandat\";s:7:\"content\";s:309:\"Hallo {$paymentInstance.firstName} {$paymentInstance.lastName}, \n\nim Anhang finden Sie ein Lastschriftmandat zu Ihrer Bestellung {$paymentInstance.orderNumber}. \nBitte senden Sie uns das komplett ausgefllte Dokument per Fax oder Email zurck.\n\nMit freundlichen Gren,\nIhr Team von {config name=shopName}\";s:11:\"contentHtml\";s:351:\"<div>\nHallo {$paymentInstance.firstName} {$paymentInstance.lastName},<br/>\n\n<br/>im Anhang finden Sie ein Lastschriftmandat zu Ihrer Bestellung {$paymentInstance.orderNumber}. \nBitte senden Sie uns das komplett ausgefllte Dokument per Fax oder Email zurck.<br/>\n\n<br/>Mit freundlichen Gren,<br/>\n<br/>Ihr Team von {config name=shopName}\n</div>\";}',47,'2'),
	(70,'config_mails','a:3:{s:7:\"subject\";s:41:\"Ihre Anmeldung bei {config name=shopName}\";s:7:\"content\";s:333:\"Hallo {salutation} {firstname} {lastname},\n \nvielen Dank fr Ihre Anmeldung in unserem Shop.\n \nSie erhalten Zugriff ber Ihre eMail-Adresse {sMAIL}\nund dem von Ihnen gewhlten Kennwort.\n \nSie knnen sich Ihr Kennwort jederzeit per eMail erneut zuschicken lassen.\n \nMit freundlichen Gren,\n \nIhr Team von {config name=shopName}\";s:11:\"contentHtml\";s:498:\"<div style=\"font-family:arial; font-size:12px;\">\n<img src=\"#\" alt=\"Logo\" />\n<p>\nHallo {salutation} {firstname} {lastname},<br/><br/>\n \nvielen Dank fr Ihre Anmeldung in unserem Shop.<br/><br/>\n \nSie erhalten Zugriff ber Ihre eMail-Adresse <strong>{sMAIL}</strong><br/>\nund dem von Ihnen gewhlten Kennwort.<br/><br/>\n \nSie knnen sich Ihr Kennwort jederzeit per eMail erneut zuschicken lassen.<br/><br/>\n \nMit freundlichen Gren,<br/><br/>\n \nIhr Team von {config name=shopName}\n</p>\n</div>\n\";}',1,'2'),
	(71,'config_mails','a:3:{s:7:\"subject\";s:41:\"Ihre Bestellung im {config name=shopName}\";s:7:\"content\";s:1951:\"Hallo {$billingaddress.firstname} {$billingaddress.lastname},\n \nvielen Dank fuer Ihre Bestellung bei {config name=shopName} (Nummer: {$sOrderNumber}) am {$sOrderDay} um {$sOrderTime}.\nInformationen zu Ihrer Bestellung:\n \nPos. Art.Nr.              Menge         Preis        Summe\n{foreach item=details key=position from=$sOrderDetails}\n{$position+1|fill:4} {$details.ordernumber|fill:20} {$details.quantity|fill:6} {$details.price|padding:8} EUR {$details.amount|padding:8} EUR\n{$details.articlename|wordwrap:49|indent:5}\n{/foreach}\n \nVersandkosten: {$sShippingCosts}\nGesamtkosten Netto: {$sAmountNet}\n{if !$sNet}\nGesamtkosten Brutto: {$sAmount}\n{/if}\n \nGewhlte Zahlungsart: {$additional.payment.description}\n{$additional.payment.additionaldescription}\n{if $additional.payment.name == \"debit\"}\nIhre Bankverbindung:\nKontonr: {$sPaymentTable.account}\nBLZ:{$sPaymentTable.bankcode}\nWir ziehen den Betrag in den nchsten Tagen von Ihrem Konto ein.\n{/if}\n{if $additional.payment.name == \"prepayment\"}\n \nUnsere Bankverbindung:\n{config name=bankAccount}\n{/if}\n \n{if $sComment}\nIhr Kommentar:\n{$sComment}\n{/if}\n \nRechnungsadresse:\n{$billingaddress.company}\n{$billingaddress.firstname} {$billingaddress.lastname}\n{$billingaddress.street} {$billingaddress.streetnumber}\n{$billingaddress.zipcode} {$billingaddress.city}\n{$billingaddress.phone}\n{$additional.country.countryname}\n \nLieferadresse:\n{$shippingaddress.company}\n{$shippingaddress.firstname} {$shippingaddress.lastname}\n{$shippingaddress.street} {$shippingaddress.streetnumber}\n{$shippingaddress.zipcode} {$shippingaddress.city}\n{$additional.country.countryname}\n \n{if $billingaddress.ustid}\nIhre Umsatzsteuer-ID: {$billingaddress.ustid}\nBei erfolgreicher Prfung und sofern Sie aus dem EU-Ausland\nbestellen, erhalten Sie Ihre Ware umsatzsteuerbefreit.\n{/if}\n \n \nFr Rckfragen stehen wir Ihnen jederzeit gerne zur Verfgung. \n\nWir wnschen Ihnen noch einen schnen Tag.\n \n{config name=address}\";s:11:\"contentHtml\";s:3747:\"<div style=\"font-family:arial; font-size:12px;\">\n \n<p>Hallo {$billingaddress.firstname} {$billingaddress.lastname},<br/><br/>\n \nvielen Dank fuer Ihre Bestellung bei {config name=shopName} (Nummer: {$sOrderNumber}) am {$sOrderDay} um {$sOrderTime}.\n<br/>\n<br/>\n<strong>Informationen zu Ihrer Bestellung:</strong></p>\n  <table width=\"80%\" border=\"0\" style=\"font-family:Arial, Helvetica, sans-serif; font-size:10px;\">\n    <tr>\n      <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Artikel</strong></td>\n      <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Pos.</strong></td>\n      <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Art-Nr.</strong></td>\n      <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Menge</strong></td>\n      <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Preis</strong></td>\n      <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Summe</strong></td>\n    </tr>\n \n    {foreach item=details key=position from=$sOrderDetails}\n    <tr>\n      <td rowspan=\"2\" style=\"border-bottom:1px solid #cccccc;\">{if $details.image.src.1}<img src=\"{$details.image.src.1}\" alt=\"{$details.articlename}\" />{else} {/if}</td>\n      <td>{$position+1|fill:4} </td>\n      <td>{$details.ordernumber|fill:20}</td>\n      <td>{$details.quantity|fill:6}</td>\n      <td>{$details.price|padding:8}{$sCurrency}</td>\n      <td>{$details.amount|padding:8} {$sCurrency}</td>\n    </tr>\n    <tr>\n      <td colspan=\"5\" style=\"border-bottom:1px solid #cccccc;\">{$details.articlename|wordwrap:80|indent:4}</td>\n    </tr>\n    {/foreach}\n \n  </table>\n \n<p>\n  <br/>\n  <br/>\n    Versandkosten: {$sShippingCosts}<br/>\n    Gesamtkosten Netto: {$sAmountNet}<br/>\n    {if !$sNet}\n    Gesamtkosten Brutto: {$sAmount}<br/>\n    {/if}\n  <br/>\n  <br/>\n    <strong>Gewhlte Zahlungsart:</strong> {$additional.payment.description}<br/>\n    {$additional.payment.additionaldescription}\n    {if $additional.payment.name == \"debit\"}\n    Ihre Bankverbindung:<br/>\n    Kontonr: {$sPaymentTable.account}<br/>\n    BLZ:{$sPaymentTable.bankcode}<br/>\n    Wir ziehen den Betrag in den nchsten Tagen von Ihrem Konto ein.<br/>\n    {/if}\n  <br/>\n  <br/>\n    {if $additional.payment.name == \"prepayment\"}\n    Unsere Bankverbindung:<br/>\n    {config name=bankAccount}\n    {/if} \n  <br/>\n  <br/>\n    <strong>Gewhlte Versandart:</strong> {$sDispatch.name}<br/>{$sDispatch.description}\n</p>\n<p>\n  {if $sComment}\n    <strong>Ihr Kommentar:</strong><br/>\n    {$sComment}<br/>\n  {/if} \n  <br/>\n  <br/>\n    <strong>Rechnungsadresse:</strong><br/>\n    {$billingaddress.company}<br/>\n    {$billingaddress.firstname} {$billingaddress.lastname}<br/>\n    {$billingaddress.street} {$billingaddress.streetnumber}<br/>\n    {$billingaddress.zipcode} {$billingaddress.city}<br/>\n    {$billingaddress.phone}<br/>\n    {$additional.country.countryname}<br/>\n  <br/>\n  <br/>\n    <strong>Lieferadresse:</strong><br/>\n    {$shippingaddress.company}<br/>\n    {$shippingaddress.firstname} {$shippingaddress.lastname}<br/>\n    {$shippingaddress.street} {$shippingaddress.streetnumber}<br/>\n    {$shippingaddress.zipcode} {$shippingaddress.city}<br/>\n    {$additional.countryShipping.countryname}<br/>\n  <br/>\n    {if $billingaddress.ustid}\n    Ihre Umsatzsteuer-ID: {$billingaddress.ustid}<br/>\n    Bei erfolgreicher Prfung und sofern Sie aus dem EU-Ausland<br/>\n    bestellen, erhalten Sie Ihre Ware umsatzsteuerbefreit.<br/>\n    {/if}\n  <br/>\n  <br/>\n    Fr Rckfragen stehen wir Ihnen jederzeit gerne zur Verfgung. Sie erreichen uns wie folgt: <br/>{config name=address}\n    <br/>\n    Mit freundlichen Gren,<br/>\n    Ihr Team von {config name=shopName}<br/>\n</p>\n</div>\";}',2,'2'),
	(72,'config_mails','a:2:{s:7:\"subject\";s:34:\"{sName} empfiehlt Ihnen {sArticle}\";s:7:\"content\";s:214:\"Hallo,\n\n{sName} hat fr Sie bei {sShop} ein interessantes Produkt gefunden, dass Sie sich anschauen sollten:\n\n{sArticle}\n{sLink}\n\n{sComment}\n\nBis zum naechsten Mal und mit freundlichen Gruessen,\n\nIhre Kontaktdaten\";}',3,'2'),
	(73,'config_mails','a:2:{s:7:\"subject\";s:49:\"Passwort vergessen - Ihre Zugangsdaten zu {sShop}\";s:7:\"content\";s:174:\"Hallo,\n\nIhre Zugangsdaten zu {sShopURL} lauten wie folgt:\nBenutzer: {sMail}\nPasswort: {sPassword}\n\nBis zum naechsten Mal und mit freundlichen Gruessen,\n\n{config name=address}\";}',4,'2'),
	(74,'config_mails','a:2:{s:7:\"subject\";s:56:\"Achtung - keine freien Seriennummern fr {sArticleName}\";s:7:\"content\";s:205:\"Hallo,\n\nes sind keine weiteren freien Seriennummern fr den Artikel {sArticleName} verfgbar. Bitte stellen Sie umgehend neue Seriennummern ein oder deaktivieren Sie den Artikel. \n\n{config name=shopName}\";}',5,'2'),
	(75,'config_mails','a:2:{s:7:\"subject\";s:13:\"Ihr Gutschein\";s:7:\"content\";s:291:\"Hallo {customer},\n\n{user} ist Ihrer Empfehlung gefolgt und hat so eben im Demoshop bestellt.\nWir schenken Ihnen deshalb einen X  Gutschein, den Sie bei Ihrer nchsten Bestellung einlsen knnen.\n			\nIhr Gutschein-Code lautet: XXX\n			\nViele Gre,\n\nIhr Team von {config name=shopName}\";}',7,'2'),
	(76,'config_mails','a:2:{s:7:\"subject\";s:40:\"Ihr Hndleraccount wurde freigeschaltet\";s:7:\"content\";s:188:\"Hallo,\n\nIhr Hndleraccount auf {config name=shopName} wurde freigeschaltet\n\nAb sofort kaufen Sie zum Netto-EK bei uns ein.\n\nMit freundlichen Gren,\n\nIhr Team von {config name=shopName}\";}',12,'2'),
	(77,'config_mails','a:2:{s:7:\"subject\";s:35:\"Ihr Hndleraccount wurde abgelehnt\";s:7:\"content\";s:372:\"Sehr geehrter Kunde,\n\nvielen Dank fr Ihr Interesse an unseren Fachhandelspreisen. Leider liegt uns aber noch kein Gewerbenachweis vor bzw. leider knnen wir Sie nicht als Fachhndler anerkennen.\n\nBei Rckfragen aller Art knnen Sie uns gerne telefonisch, per Fax oder per Mail diesbezglich erreichen.\n\nMit freundlichen Gren\n\nIhr Team von {config name=shopName}\";}',13,'2'),
	(78,'config_mails','a:2:{s:7:\"subject\";s:75:\"Ihre abgebrochene Bestellung - Jetzt Feedback geben und Gutschein kassieren\";s:7:\"content\";s:479:\"Lieber Kunde,\n \nsie haben vor kurzem Ihre Bestellung auf Demoshop.de nicht bis zum Ende durchgefhrt - wir sind stets bemht unseren Kunden das Einkaufen in unserem Shop so angenehm wie mglich zu machen und wrden deshalb gerne wissen, woran Ihr Einkauf bei uns gescheitert ist.\n \nBitte lassen Sie uns doch den Grund fr Ihren Bestellabbruch zukommen, Ihren Aufwand entschdigen wir Ihnen in jedem Fall mit einem 5,00  Gutschein.\n \nVielen Dank fr Ihre Untersttzung.\";}',19,'2'),
	(79,'config_mails','a:2:{s:7:\"subject\";s:51:\"Ihre abgebrochene Bestellung - Gutschein-Code anbei\";s:7:\"content\";s:408:\"Lieber Kunde,\n \nsie haben vor kurzem Ihre Bestellung auf Demoshop.de nicht bis zum Ende durchgefhrt - wir mchten Ihnen heute einen 5,00  Gutschein zukommen lassen - und Ihnen hiermit die Bestell-Entscheidung auf demoshop.de erleichtern.\n \nIhr Gutschein ist 2 Monate gltig und kann mit dem Code \"{$sVouchercode}\" eingelst werden.\n\nWir wrden uns freuen, Ihre Bestellung entgegen nehmen zu drfen.\";}',20,'2'),
	(80,'config_mails','a:2:{s:7:\"subject\";s:65:\"Herzlichen Glckwunsch zum Geburtstag von {config name=shopName}\";s:7:\"content\";s:194:\"Hallo {if $sUser.salutation eq \"mr\"}Herr{elseif $sUser.billing_salutation eq \"ms\"}Frau{/if} {$sUser.firstname} {$sUser.lastname},\n\nMit freundlichen Gren,\n\nIhr Team von {config name=shopName}\";}',39,'2'),
	(81,'config_mails','a:2:{s:7:\"subject\";s:86:\"Lagerbestand von {$sData.count} Artikel{if $sData.count>1}n{/if} unter Mindestbestand \";s:7:\"content\";s:262:\"Hallo,\n\nfolgende Artikel haben den Mindestbestand unterschritten:\n\nBestellnummer Artikelname Bestand/Mindestbestand \n{foreach from=$sJob.articles item=sArticle key=key}\n{$sArticle.ordernumber} {$sArticle.name} {$sArticle.instock}/{$sArticle.stockmin} \n{/foreach}\";}',40,'2'),
	(82,'config_mails','a:2:{s:7:\"subject\";s:43:\"Vielen Dank fr Ihre Newsletter-Anmeldung \";s:7:\"content\";s:169:\"Hallo,\n\nvielen Dank fr Ihre Newsletter-Anmeldung bei {config name=shopName}.\n\nViele Gre,\n\nIhr Team von {config name=shopName}\n\n\nKontaktdaten:\n{config name=address}\";}',41,'2'),
	(83,'config_mails','a:2:{s:7:\"subject\";s:47:\"Bitte besttigen Sie Ihre Newsletter-Anmeldung\";s:7:\"content\";s:228:\"Hallo, \n\nvielen Dank fr Ihre Anmeldung zu unserem regelmig erscheinenden Newsletter. \n\nBitte besttigen Sie die Anmeldung ber den nachfolgenden Link: {$sConfirmLink} \n\n\nViele Gre\n\nIhr Team von {config name=shopName}\";}',42,'2'),
	(84,'config_mails','a:2:{s:7:\"subject\";s:44:\"Bitte besttigen Sie Ihre Artikel-Bewertung\";s:7:\"content\";s:182:\"Hallo, \n\nvielen Dank fr die Bewertung des Artikels {$sArticle.articleName}. \n\nBitte besttigen Sie die Bewertung ber nach den nachfolgenden Link: {$sConfirmLink} \n\nViele Gre\";}',43,'2'),
	(85,'config_mails','a:2:{s:7:\"subject\";s:33:\"Ihr Artikel ist wieder verfgbar\";s:7:\"content\";s:155:\"Hallo,\n\nIhr Artikel mit der Bestellnummer {$sOrdernumber} ist jetzt wieder verfgbar.\n\n{$sArticleLink}\n\nViele Gre\n\nIhr Team von {config name=shopName}\";}',44,'2'),
	(86,'config_mails','a:2:{s:7:\"subject\";s:50:\"Bitte besttigen Sie Ihre E-Mail-Benachrichtigung\";s:7:\"content\";s:277:\"Hallo,\n\nvielen Dank, dass Sie sich fr die automatische e-Mail Benachrichtigung fr den Artikel {$sArticleName} eingetragen haben.\n\nBitte besttigen Sie die Benachrichtigung ber den nachfolgenden Link: \n\n{$sConfirmLink}\n\nViele Gre \n\nIhr Team von {config name=shopName}\";}',45,'2'),
	(87,'config_mails','a:3:{s:7:\"subject\";s:16:\"Artikel bewerten\";s:7:\"content\";s:689:\"Hallo {if $sUser.salutation eq \"mr\"}Herr{elseif $sUser.billing_salutation eq \"ms\"}Frau{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n\n\nSie haben bei uns vor einigen Tagen Artikel gekauft. Wir wrden uns freuen, wenn Sie diese Artikel bewerten wrden.<br/>\nSo helfen Sie uns, unseren Service weiter zu steigern und Sie knnen auf diesem Weg anderen Interessenten direkt Ihre Meinung mitteilen.\n\n\nHier finden Sie die Links zum Bewerten der von Ihnen gekauften Produkte.\n\n{foreach from=$sArticles item=sArticle key=key}\n{if !$sArticle.modus}\n{$sArticle.articleordernumber} {$sArticle.name} {$sArticle.link}\n{/if}\n{/foreach}\n\nViele Gre,\n\nIhr Team von {config name=shopName}\";s:11:\"contentHtml\";s:812:\"<div>\nHallo {if $sUser.salutation eq \"mr\"}Herr{elseif $sUser.billing_salutation eq \"ms\"}Frau{/if} {$sUser.billing_firstname} {$sUser.billing_lastname},\n<br/>\nSie haben bei uns vor einigen Tagen Artikel gekauft. Wir wrden uns freuen, wenn Sie diese Artikel bewerten wrden.<br/>\nSo helfen Sie uns, unseren Service weiter zu steigern und Sie knnen auf diesem Weg anderen Interessenten direkt Ihre Meinung mitteilen.\n<br/><br/>\n\nHier finden Sie die Links zum Bewerten der von Ihnen gekauften Produkte.\n\n<table>\n {foreach from=$sArticles item=sArticle key=key}\n{if !$sArticle.modus}\n <tr>\n  <td>{$sArticle.articleordernumber}</td>\n  <td>{$sArticle.name}</td>\n  <td>\n  <a href=\"{$sArticle.link}\">link</a>\n  </td>\n </tr>\n{/if}\n {/foreach}\n</table>\n\n\nViele Gre,<br />\nIhr Team von {config name=shopName}\n</div>\";}',46,'2'),
	(116,'article','a:3:{s:10:\"txtArtikel\";s:15:\"Pillow - Flower\";s:19:\"txtshortdescription\";s:400:\"Eo Opera Ora ullus Decolor, Caleo. Evolo cui patior, creptio quo debeo sus perspicax. Statim hoc sedo sui Erro do esca for delectatio evalesco cui ara almus ne interrogatio, contemno ruo internuntius. Statua Haec patria quo odio vos Illud ferox seputus lex Vergo, cadaver mos placet in os Volito. Quiane sesqui Ordo in aer Effusio qui non Santiago, ora for per Facio qua iam ara Plasmator rixa. Natu.\";s:19:\"txtlangbeschreibung\";s:407:\"<p>Eo Opera Ora ullus Decolor, Caleo. Evolo cui patior, creptio quo debeo sus perspicax. Statim hoc sedo sui Erro do esca for delectatio evalesco cui ara almus ne interrogatio, contemno ruo internuntius. Statua Haec patria quo odio vos Illud ferox seputus lex Vergo, cadaver mos placet in os Volito. Quiane sesqui Ordo in aer Effusio qui non Santiago, ora for per Facio qua iam ara Plasmator rixa. Natu.</p>\";}',222,'2'),
