	(138,'article','a:3:{s:10:\"txtArtikel\";s:23:\"Emmelkamp elder liqueur\";s:19:\"txtlangbeschreibung\";s:407:\"<p>Ita si ardor laxe eu Cogo arx subaudio. Os, color attero, an. Hi inservio quatenus/quatinus, eu. Pax percunctor, ut. Me Mica. Ne, in plus neo pars ne navale quo Heniis varius, St. Iam vae ne inter Idem devenio parum accredo Neco nam byssus ales an Seu re is, mors vir incrementabiliter hio desisto Noxa chirographum eo, os, agon os nec lac enucleo his ile pes vos Suppellex, re. Vae libro corium Pul.</p>\";s:11:\"txtpackunit\";s:7:\"Bottles\";}',5,'2'),
	(142,'article','a:3:{s:10:\"txtArtikel\";s:10:\"Oil Change\";s:19:\"txtshortdescription\";s:125:\"Ita si ardor laxe eu Cogo arx subaudio. Os, color attero, an. Hi inservio quatenus/quatinus, eu. Pax percunctor, ut. Me Mica.\";s:19:\"txtlangbeschreibung\";s:407:\"<p>Ita si ardor laxe eu Cogo arx subaudio. Os, color attero, an. Hi inservio quatenus/quatinus, eu. Pax percunctor, ut. Me Mica. Ne, in plus neo pars ne navale quo Heniis varius, St. Iam vae ne inter Idem devenio parum accredo Neco nam byssus ales an Seu re is, mors vir incrementabiliter hio desisto Noxa chirographum eo, os, agon os nec lac enucleo his ile pes vos Suppellex, re. Vae libro corium Pul.</p>\";}',43,'2'),
