	(154,'article','a:2:{s:10:\"txtArtikel\";s:7:\"Napkins\";s:19:\"txtlangbeschreibung\";s:407:\"<p>S aequor incrementabiliter res, inhumanitas enim ars ara Noxa tunc aqua refrigerium Formica suspicio misericordaliter aer impenetrabiilis, turpiter familiaritas hac concupiscentia, alias cattus obvolvo Northmanni huic. Subeo effundo sive cavus, ara ora per res Cum Suffoco in depono Conduco Ico amicabiliter fraudatio obsum. Humo to qui quin ne pes castellatim pertingo, leo te Subduco sol quaestuos.</p>\";}',236,'2'),
	(156,'article','a:2:{s:10:\"txtArtikel\";s:8:\"Deco pot\";s:19:\"txtlangbeschreibung\";s:406:\"<p>Carectum, vos Genitus persto Expeto, discedo an usitas ferrugo, nisi illis me cogitatus. Per Per beo donum hac edo voro, ymo at gero garrio subicio. Ager texo Inglorius is, sino Usura, sol Secus. Pie Abeo lac amo quo praeoccupor voluntarius. Os levitas sed Penis fio ars luo latro no inaestimabilis. Modestia nitor utor at Fleo aversor. Do promissio perfusus Pinguis, generosus elabor dono cado his.</p>\";}',235,'2'),
	(158,'article','a:3:{s:10:\"txtArtikel\";s:30:\"Deduction with payment methods\";s:19:\"txtshortdescription\";s:68:\"In Shopware, you can define deductions with certain payment methods.\";s:19:\"txtlangbeschreibung\";s:75:\"<p>In Shopware, you can define deductions with certain payment methods.</p>\";}',230,'2'),
	(159,'article','a:2:{s:10:\"txtArtikel\";s:14:\"Magnets London\";s:19:\"txtlangbeschreibung\";s:407:\"<p>Eo at fama desudo se Unda, cum miro caries notarius voro corrigo Priscus, per jus promo fama profero Verto premo Palaestra mihi replico pax rudo baro conjux suus. Sem et lenis castra illa hostis cedo, ops hac quod, vel adsum abeo solito Inibi. Furibundus Se cupidus Noxa ut Cautus Plura hac res Gens Censeo, bos Os, dissemino hac vae ter Consonum nam lacrima increpo rogo. evoco tremo bene Corrumpo .</p>\";}',229,'2'),
	(160,'article','a:3:{s:10:\"txtArtikel\";s:33:\"Payment methods & risk management\";s:19:\"txtshortdescription\";s:75:\"In Shopware, you have different opportunities to handle the risk management\";s:19:\"txtlangbeschreibung\";s:268:\"<p>In Shopware, you have different opportunities to handle the risk management. You can use them or other factors to define certain payment methods for certain customer groups.</p>\n<p>In this example, you are not offered the payment method \"invoice\" for instance\".</p>\";}',228,'2'),
	(161,'article','a:3:{s:10:\"txtArtikel\";s:30:\"Surcharge with payment methods\";s:19:\"txtshortdescription\";s:67:\"In Shopware, you can define surcharges with desired payment methods\";s:19:\"txtlangbeschreibung\";s:165:\"<p>In Shopware, you can define surcharges with desired payment methods. In this example we defined a surcharge of 5&nbsp; &euro; for the payment method \"invoice\"</p>\";}',227,'2'),
	(163,'article','a:3:{s:10:\"txtArtikel\";s:24:\"Alternate shipping costs\";s:19:\"txtshortdescription\";s:80:\"This shipping type ramifies in case the standard shipping type is not available.\";s:19:\"txtlangbeschreibung\";s:87:\"<p>This shipping type ramifies in case the standard shipping type is not available.</p>\";}',223,'2'),
	(164,'article','a:3:{s:10:\"txtArtikel\";s:16:\"Deco pillow Bird\";s:19:\"txtshortdescription\";s:105:\"In hac alibi Pario nutus, Distinguo Barbare opto recidivus, iam tot do ruo volatilis Solito incompositus \";s:19:\"txtlangbeschreibung\";s:407:\"<p>In hac alibi Pario nutus, Distinguo Barbare opto recidivus, iam tot do ruo volatilis Solito incompositus perimo quicquid tergiversatio ops labruscum Trutino, studium superstes in parcus intorqueo eo. Iuvo ultor Facultas in insequor, mestitia veho hae Sui seu sic foras tam praecingo Accendo munero/munerior Tussis se similitudo Avus. Indigus per tumultus Terrenus iam Tam regno re pratum crystallinu.</p>\";}',225,'2'),
	(165,'article','a:3:{s:10:\"txtArtikel\";s:22:\"Shipping costs options\";s:19:\"txtshortdescription\";s:71:\"Check out various configurations concerning the shipping costs setting.\";s:19:\"txtlangbeschreibung\";s:283:\"<p>Check out various configurations concerning the shipping costs setting.</p>\n<p>Define standard shipping types, alternate shipping types, surcharge shipping types and more.</p>\n<p>You can also define shipping costs for weight, price, amot of articles and your own calculations.</p>\";}',221,'2'),
	(166,'article','a:3:{s:10:\"txtArtikel\";s:30:\"Article free of shipping costs\";s:19:\"txtshortdescription\";s:165:\"You have the opportunity to ship an article free of shipping costs. All you have to do is selecting the field \"free of shipping costs\" in the article data overview. \";s:19:\"txtlangbeschreibung\";s:237:\"<p>You have the opportunity to ship an article free of shipping costs. All you have to do is selecting the field \"free of shipping costs\" in the article data overview.</p>\n<p>Add this article to you shopping cart an watch the result.</p>\";}',220,'2'),
	(167,'article','a:3:{s:10:\"txtArtikel\";s:16:\"Express shipping\";s:19:\"txtshortdescription\";s:130:\"In Shopware , you have the opportunity to ship an article via express. This way, of cource, the customer is charged a higher fee. \";s:19:\"txtlangbeschreibung\";s:240:\"<p>In Shopware , you have the opportunity to ship an article via express. This way, of cource, the customer is charged a higher fee.</p>\n<p>To do so, you can choose between \"normal\" and \"express\" during the checkout process.<br /><br /></p>\";}',219,'2'),
	(168,'article','a:2:{s:19:\"txtshortdescription\";s:119:\"Ichilominus Fultus ordior, ora Sterilis qua Se sum cum Conspicio sed Eo at ver oportet, filia cedo comprehendo baccatus\";s:19:\"txtlangbeschreibung\";s:407:\"<p>Ichilominus Fultus ordior, ora Sterilis qua Se sum cum Conspicio sed Eo at ver oportet, filia cedo comprehendo baccatus. Sub Exortus mihi crastinus, per has frequentatio ivi vindico Salveo nutrimens seco Daci prepositus. Ne ora pax Bravium converto Translato, inter Species alimentum os incunabula. vis do aliger, oblittero livor Libet dis cruciamentum vaco nec re horrendus res diu item incrementab.</p>\";}',218,'2'),
	(169,'article','a:3:{s:10:\"txtArtikel\";s:10:\"Surf board\";s:19:\"txtshortdescription\";s:148:\"Enego Do Loci his simul creta humilitas, Excello, se, sis ne fere Amotio turba excedo se res domito Villa, in, fundo novem, per qua tam Acer cornu. \";s:19:\"txtlangbeschreibung\";s:407:\"<p>Enego Do Loci his simul creta humilitas, Excello, se, sis ne fere Amotio turba excedo se res domito Villa, in, fundo novem, per qua tam Acer cornu. Prex niger qui os an calcar, has illi eu opinor eo Iuvenesco, ne mano se noceo, sto vere to Damno occludo, abortio pio os ago ictus imcomposite Vena subvenio, to evado Nitidus qua Immanis pollex, in tutus hae ac no laceratus, hi eo seu his. Laxo se fu.</p>\";}',213,'2'),
	(170,'article','a:3:{s:10:\"txtArtikel\";s:55:\"Bonus article with shopping cart value of over 250 Euro\";s:19:\"txtshortdescription\";s:122:\"Your customers can either buy this article or get it as a free bonus article from a shopping cart value of over 250 Euros.\";s:19:\"txtlangbeschreibung\";s:225:\"<p>Your customers can either buy this article or get it as a free bonus article from a shopping cart value of over 250 Euro.</p>\n<p>This function needs to be activated in your backend under Configuration --&gt; Frontend</p>\";}',211,'2'),
	(172,'article','a:3:{s:10:\"txtArtikel\";s:54:\"Bonus article with shopping cart value of over 50 Euro\";s:19:\"txtshortdescription\";s:122:\"Your customers can either buy this article or get it as a free bonus article from a shopping cart value of over 250 Euros.\";s:19:\"txtlangbeschreibung\";s:224:\"<p>Your customers can either buy this article or get it as a free bonus article from a shopping cart value of over 50 Euro.</p>\n<p>This function needs to be activated in your backend under Configuration --&gt; Frontend</p>\";}',210,'2'),
	(174,'article','a:3:{s:10:\"txtArtikel\";s:16:\"Graduated prices\";s:19:\"txtshortdescription\";s:99:\"Graduated prices offer the opportunity to claim different prices for different purchase quantities.\";s:19:\"txtlangbeschreibung\";s:106:\"<p>Graduated prices offer the opportunity to claim different prices for different purchase quantities.</p>\";}',209,'2'),
	(175,'article','a:3:{s:10:\"txtArtikel\";s:12:\"Pseudo price\";s:19:\"txtshortdescription\";s:164:\"The pseudo price appears small and crossed out above the actual price of the article. You can easily manage this function in the backend while creating an article. \";s:19:\"txtlangbeschreibung\";s:184:\"<p>The pseudo price appears small and crossed out above the actual price of the article. You can easily manage this function in the backend while creating an article.</p>\n<p>&nbsp;</p>\";}',208,'2'),
	(179,'article','a:3:{s:10:\"txtArtikel\";s:45:\"Graduated prices, min./max. purchase quantity\";s:19:\"txtshortdescription\";s:92:\"You can define min. and max purchase quantities already in the standard version of Shopware.\";s:19:\"txtlangbeschreibung\";s:99:\"<p>You can define min. and max purchase quantities already in the standard version of Shopware.</p>\";}',207,'2'),
	(181,'article','a:3:{s:10:\"txtArtikel\";s:36:\"Article with basic price calculation\";s:19:\"txtshortdescription\";s:77:\"You can define the basic article price for every article and everey category.\";s:19:\"txtlangbeschreibung\";s:84:\"<p>You can define the basic article price for every article and everey category.</p>\";}',206,'2'),
	(182,'article','a:3:{s:10:\"txtArtikel\";s:35:\"Article with surcharge configurator\";s:19:\"txtshortdescription\";s:83:\"The connection between configurator and accessory function offers new opportunities\";s:19:\"txtlangbeschreibung\";s:212:\"<p>The connection between configurator and accessory function offers new opportunities. Your customers can put together their own articles and add their creation to the shopping cart with a single mouseclick.</p>\";}',205,'2'),
	(184,'article','a:3:{s:10:\"txtArtikel\";s:31:\"Article with table configurator\";s:19:\"txtshortdescription\";s:163:\"With this configurator variant, your customer gets displayed the selecting opportunities in a table. This way, he can see, which options he has and what they cost.\";s:19:\"txtlangbeschreibung\";s:170:\"<p>With this configurator variant, your customer gets displayed the selecting opportunities in a table. This way, he can see, which options he has and what they cost.</p>\";}',204,'2'),
	(185,'article','a:3:{s:10:\"txtArtikel\";s:32:\"Article with choice configurator\";s:19:\"txtshortdescription\";s:111:\"In contrast to the standard configurator, the order of the choice configurator has to be executed step by step.\";s:19:\"txtlangbeschreibung\";s:264:\"<p>In contrast to the standard configurator, the order of the choice configurator has to be executed step by step. Having made the first selection, the second box will be activated. Only after filling out the last box, the shopping cart button becomes visible.</p>\";}',203,'2'),
	(187,'article','a:3:{s:10:\"txtArtikel\";s:34:\"Article with standard configurator\";s:19:\"txtshortdescription\";s:192:\"The standard configurator offers the opportunity, to selct the desired constellation, without following a certain order. All groups can be selected by customers with the corresponding options.\";s:19:\"txtlangbeschreibung\";s:199:\"<p>The standard configurator offers the opportunity, to selct the desired constellation, without following a certain order. All groups can be selected by customers with the corresponding options.</p>\";}',202,'2'),
